  true,\n\t\"url\": null,\n\t\"notes\": \"<p>The Adverse Event Reporting System (AERS)
  is a computerized information database designed to support the FDA's post-marketing
  safety surveillance program for all approved drug and therapeutic biologic products.
  The FDA uses AERS to monitor for new adverse events and medication errors that might
  occur with these marketed products. Reporting of adverse events from the point of
  care is voluntary in the United States. FDA receives some adverse event and medication
  error reports directly from health care professionals (such as physicians, pharmacists,
  nurses and others) and consumers (such as patients, family members, lawyers and
  others). Healthcare professionals and consumers may also report these events to
  the products' manufacturers. If a manufacturer receives an adverse event report,
  it is required to send the report to FDA as specified by regulations.  The files
  listed on this page contain raw data extracted from the AERS database for the indicated
  time ranges and are not cumulative. Users of these files need to be familiar with
  creation of relational databases using applications such as ORACLE, Microsoft Office
  Access, MySQL and IBM DB2 or the use of ASCII files with SAS analytic tools. A simple
  search of AERS data cannot be performed with these files by persons who are not
  familiar with creation of relational databases.</p>n\",\n\t\"license_title\": \"Other
